import style from "../SearchBar/searchBar.module.css";
import { useState } from "react";
import { Link } from "react-router-dom";

export default function SearchBar(props) {
  const [character, setCharacter] = useState("");
  const handleInput = (e) => {
    setCharacter(e.target.value);
  };

  const handleButton = () => {
    props.onSearch(character);
  };

  const clase = ["buton", "ln"];
  return (
    <div className={style.div}>
      <input type="search" className={style.input} onChange={handleInput} />
      <div className={clase.join(" ")}>
        <Link to={"/about"} className={style.ln}>
          ABOUT
        </Link>
      </div>
      <div className={style.buton + " ln"}>
        <Link to={"/home"}>HOME</Link>
      </div>
      <button className={style.buton} onClick={handleButton}>
        Agregar
      </button>
    </div>
  );
}
